import React from 'react';
import './Main.module.scss'; // Import the SCSS file

import bgVideo from './spaceLoop.gif';

const Main = () => {
  return (
    <div className="bg-Video">
      <img src={bgVideo} alt="Background GIF" className="bgGif" />
      <div className='mainContent'>
        hello
      </div>
    </div>
  );
}

export default Main;
